import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const RegisterUser = () => {
    const navigate = useNavigate();

    const [fullName, setFullName] = useState("");
    const [email, setEmail] = useState("");
    const [address, setAddress] = useState("");
    const [city, setCity] = useState("");
    const [country, setCountry] = useState("");
    const [state, setState] = useState("");
    const [zipcode, setZipcode] = useState("");
    const [sodaCount, setSodaCount] = useState(0);
    const [billingSame, setBillingSame] = useState(false);
    const [error, setError] = useState("");  // To store any error message

    const handleSubmit = async (e) => {
        e.preventDefault();

        const userData = {
            fullName,
            email,
            address,
            city,
            country,
            state,
            zipcode,
            sodaCount,
            billingSame,
        };

        try {
            // Make a POST request to your backend to register the user
            const response = await axios.post("http://localhost:5001/register", userData);

            if (response.status === 201) {
                // On success, redirect the user to the login page or another route
                navigate("/login");
            }
        } catch (error) {
            console.error("Registration error:", error.response ? error.response.data : error);
            setError("There was an issue with your registration. Please try again.");
        }
    };

    return (
        <div className="min-h-screen p-6 bg-gray-100 flex items-center justify-center">
            <div className="container max-w-screen-lg mx-auto">
                <div>
                    <h2 className="font-semibold text-xl text-gray-600">Register User</h2>
                    <p className="text-gray-500 mb-6">Please fill out the form to register.</p>

                    <div className="bg-white rounded shadow-lg p-4 px-4 md:p-8 mb-6">
                        <form onSubmit={handleSubmit} className="grid gap-4 gap-y-2 text-sm grid-cols-1 lg:grid-cols-3">
                            <div className="text-gray-600">
                                <p className="font-medium text-lg">Personal Details</p>
                                <p>Please fill out all the fields.</p>
                            </div>

                            <div className="lg:col-span-2">
                                <div className="grid gap-4 gap-y-2 text-sm grid-cols-1 md:grid-cols-5">
                                    {/* Full Name */}
                                    <div className="md:col-span-5">
                                        <label for="full_name">Full Name</label>
                                        <input
                                            type="text"
                                            name="full_name"
                                            id="full_name"
                                            className="h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={fullName}
                                            onChange={(e) => setFullName(e.target.value)}
                                        />
                                    </div>

                                    {/* Email Address */}
                                    <div className="md:col-span-5">
                                        <label for="email">Email Address</label>
                                        <input
                                            type="text"
                                            name="email"
                                            id="email"
                                            className="h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={email}
                                            onChange={(e) => setEmail(e.target.value)}
                                            placeholder="email@domain.com"
                                        />
                                    </div>

                                    {/* Address */}
                                    <div className="md:col-span-3">
                                        <label for="address">Address / Street</label>
                                        <input
                                            type="text"
                                            name="address"
                                            id="address"
                                            className="h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={address}
                                            onChange={(e) => setAddress(e.target.value)}
                                        />
                                    </div>

                                    {/* City */}
                                    <div className="md:col-span-2">
                                        <label for="city">City</label>
                                        <input
                                            type="text"
                                            name="city"
                                            id="city"
                                            className="h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={city}
                                            onChange={(e) => setCity(e.target.value)}
                                        />
                                    </div>

                                    {/* Country */}
                                    <div className="md:col-span-2">
                                        <label for="country">Country / Region</label>
                                        <input
                                            type="text"
                                            name="country"
                                            id="country"
                                            className="h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={country}
                                            onChange={(e) => setCountry(e.target.value)}
                                        />
                                    </div>

                                    {/* State */}
                                    <div className="md:col-span-2">
                                        <label for="state">State / Province</label>
                                        <input
                                            type="text"
                                            name="state"
                                            id="state"
                                            className="h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={state}
                                            onChange={(e) => setState(e.target.value)}
                                        />
                                    </div>

                                    {/* Zipcode */}
                                    <div className="md:col-span-1">
                                        <label for="zipcode">Zipcode</label>
                                        <input
                                            type="text"
                                            name="zipcode"
                                            id="zipcode"
                                            className="transition-all flex items-center h-10 border mt-1 rounded px-4 w-full bg-gray-50"
                                            value={zipcode}
                                            onChange={(e) => setZipcode(e.target.value)}
                                        />
                                    </div>

                                    {/* Billing Address */}
                                    <div className="md:col-span-5">
                                        <div className="inline-flex items-center">
                                            <input
                                                type="checkbox"
                                                name="billing_same"
                                                id="billing_same"
                                                className="form-checkbox"
                                                checked={billingSame}
                                                onChange={() => setBillingSame(!billingSame)}
                                            />
                                            <label for="billing_same" className="ml-2">My billing address is different than above.</label>
                                        </div>
                                    </div>

                                    {/* Soda Count */}
                                    <div className="md:col-span-2">
                                        <label for="soda">How many soda pops?</label>
                                        <div className="h-10 w-28 bg-gray-50 flex border border-gray-200 rounded items-center mt-1">
                                            <button
                                                type="button"
                                                onClick={() => setSodaCount(Math.max(0, sodaCount - 1))}
                                                className="cursor-pointer outline-none focus:outline-none border-r border-gray-200 transition-all text-gray-500 hover:text-blue-600"
                                            >
                                                <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 mx-2" viewBox="0 0 20 20" fill="currentColor">
                                                    <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
                                                </svg>
                                            </button>
                                            <input
                                                name="soda"
                                                id="soda"
                                                value={sodaCount}
                                                className="px-2 text-center appearance-none outline-none text-gray-800 w-full bg-transparent"
                                                readOnly
                                            />
                                            <button
                                                type="button"
                                                onClick={() => setSodaCount(sodaCount + 1)}
                                                className="cursor-pointer outline-none focus:outline-none border-l border-gray-200 transition-all text-gray-500 hover:text-blue-600"
                                            >
                                                <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 mx-2 fill-current" viewBox="0 0 20 20" fill="currentColor">
                                                    <path fillRule="evenodd" d="M14.707 12.707a1 1 0 01-1.414 0L10 9.414l-3.293 3.293a1 1 0 01-1.414-1.414l4-4a1 1 0 011.414 0l4 4a1 1 0 010 1.414z" clipRule="evenodd" />
                                                </svg>
                                            </button>
                                        </div>
                                    </div>

                                    {/* Submit Button */}
                                    <div className="md:col-span-5 text-right">
                                        <div className="inline-flex items-end">
                                            <button type="submit" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">Register</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </form>
                    </div>
                </div>

                {error && <p className="text-red-500 text-center mt-4">{error}</p>}
            </div>
        </div>
    );
};

export default RegisterUser;
